### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Time Complexity and Big-O Notation**
- **Concepts**: Understanding the time complexity of algorithms, Big-O notation, and how to analyze the efficiency of algorithms.
- **Equations**:
  - \( O(\log n) \)
  - \( O(n \log n) \)
  - \( O(n^2) \)
  - \( O(n) \)

#### 2. **Sorting Algorithms**
- **Concepts**: Insertion Sort, Merge Sort, Selection Sort, and their time complexities.
- **Principles**:
  - **Insertion Sort**: Worst-case time complexity \( O(n^2) \), best-case \( O(n) \).
  - **Merge Sort**: Time complexity \( O(n \log n) \), stable sorting algorithm.
  - **Selection Sort**: Time complexity \( O(n^2) \), in-place sorting algorithm.

#### 3. **Binary Search**
- **Concepts**: Binary search algorithm and its time complexity.
- **Principles**: Maximum number of comparisons in the worst-case scenario, effect of doubling the number of items.

#### 4. **Graph Algorithms**
- **Concepts**: Breadth-First Search (BFS) and Depth-First Search (DFS).
- **Principles**:
  - **BFS**: Explores all nodes at the present depth level before moving on to nodes at the next depth level.
  - **DFS**: Explores as far as possible along each branch before backtracking.

#### 5. **Data Structures**
- **Concepts**: Linked Lists, Stacks, Queues, Hash Tables, and Graphs.
- **Principles**:
  - **Linked Lists**: Operations like insertion, deletion, and traversal.
  - **Stacks and Queues**: Basic operations like push, pop, enqueue, and dequeue.
  - **Hash Tables**: Collision resolution techniques like linear probing.
  - **Graphs**: Representation using adjacency lists, BFS and DFS traversals.

#### 6. **Recursion**
- **Concepts**: Recursive functions and their time complexity.
- **Principles**: Counting recursive calls, understanding the base case and recursive case.

